import React, { useState } from 'react';
import TextField from '@material-ui/core/TextField';
import Grid from '@material-ui/core/Grid';
import {isString} from '../validators/inputValidations'
import { connect } from 'react-redux';
import {nameData} from '../actions/formActions'
import Navigation from '../components/navigation'


export default function ClaimDependents(){
    const [deps, setDeps] = useState(props.formReducer.step3);

    return (
        <Grid 
        container 
        justify="center" 
        alignItems="center" 
        className="mainGrid"
        >
            <Grid item className="gridHeading">
                <h1 className="heading">Claim Dependents</h1>
            </Grid>

            <Grid 
                container 
                item 
                key={deps.qualifyingChildren} 
                xs={12} 
                className="root" >
                    <TextField 
                        className="root" 
                        label='qualifyingChildren' 
                        variant="outlined" 
                        value={name[nameObj]} 
                        onChange={(ev) => validateText(ev,nameObj,name,setName)}
                    />
                </Grid>

            <Grid item className="wording">
            </Grid>

            <Navigation prev="/step1/address" next="/step1/done" />

        </Grid>
    )
}
